section .text
	global _start

; Hello, I am a comment outside the function
_start:
	; Hello, I am a comment inside the function
	mov rax, 1
	mov rdi, 1
	lea rsi, [rel text]
	mov rdx, len
	syscall

	call foo

	mov rax, 1
	mov rdi, 1
	lea rsi, [rel after_big_text]
	mov rdx, len_after_big_text
	syscall

	mov rax, 60
	mov rdi, 0
	syscall

; rsp + 8 => len
; rsp + 16 => current pointer to character
foo:
	push rbp				; Create stack frame
	mov rbp, rsp			; ...
	push len				; Save len
	lea r8, [rel text]		; Save current poiner to character
	push r8					; ...
begin_loop:
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	lea rsi, [rel separator]		; Set data to separator
	mov rdx, len_separator			; Set length to len_separator
	syscall							; Write data
	mov r8, [rbp - 16]				; Get current pointer to character
	mov r9b, [r8]					; Get current character
	cmp r9b, 0x0A
	je print_newline
	cmp r9b, 0x09
	je print_tab
	cmp r9b, 0x22
	je print_quote
print_character:
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	lea rsi, [rel quote]			; Set data to a quote
	mov rdx, 1						; Set length to 1
	syscall
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	mov rsi, [rbp - 16]				; Set data to the current character
	mov rdx, 1						; Set length to 1
	syscall
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	lea rsi, [rel quote]			; Set data to a quote
	mov rdx, 1						; Set length to 1
	syscall
	jmp end_print
print_newline:
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	lea rsi, [rel newline_hex]		; Set data to newline hex representation
	mov rdx, newline_hex_len		; Set length to 1
	syscall
	jmp end_print
print_tab:
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	lea rsi, [rel tab_hex]			; Set data to tab hex representation
	mov rdx, tab_hex_len			; Set length to 1
	syscall
	jmp end_print
print_quote:
	mov rax, 1						; Set system call to write
	mov rdi, 1						; Set fd to stdout
	lea rsi, [rel quote_hex]		; Set data to quote hex representation
	mov rdx, quote_hex_len			; Set length to 1
	syscall
	jmp end_print
end_print:
	mov r8, [rbp - 8]				; Move current len to r8
	mov r9, [rbp - 16]				; Move current pointer to r9
	dec r8							; Substract one to len
	inc r9							; Go a character forward
	mov [rbp - 8], r8				; Save back len
	mov [rbp - 16], r9				; Save back pointer
	cmp r8, 0
	jne begin_loop
	mov rsp, rbp
	pop rbp
	ret

